import React from 'react'

export default function Links() {
  return (
    <div className="Links">
      <h2>View the product</h2>
      <img className="links-githublogo"alt="Github OctoCat Logo" src="/images/githublogo.png"
      />
      <h2>Read more about NOVAS</h2>
    </div>
  )
}
